void draw_start(){
    clearBuffer();
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    int pixel_buffer_start = *pixel_ctrl_ptr;
	for(int i = 0; i < 240; i ++){
		for(int j = 0; j < 320; j ++){
            volatile short int *pixel_address = pixel_buffer_start + (i << 10) + (j << 1);
            if (i >= 224){
                *pixel_address = 4101;
            } else {
                *pixel_address = start[i][j];
            }
		}
	}
}

void draw_win(){
	clearBuffer();
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    int pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	for(int i = 0; i < 240; i ++){
		for(int j = 0; j < 320; j ++){
			volatile short int *pixel_address = pixel_buffer_start + (i << 10) + (j << 1);
			*pixel_address = win[i][j];
		}
	}
char* enter = "NEXT: ENTER";
   int x = 35;
   while (*enter) {
     write_char(x, 50, *enter);
	 x += 1;
	 enter++;
   }
}

